import React from 'react'

class AddTodo extends React.Component {
    constructor(props){
        super(props)

        this.state={
            name:''
        }
    }
    
    return(){
        return(
            <>
            <button>New Todo +</button>
            <span>
                Name:
            </span>
            <input type="text"/>
            <button>Add Todo</button>
            </>
        )
    }
        
}

export default AddTodo
